import styles from "./Registered.module.scss";
import buttonStyles from "../../styles/components/buttons.module.scss";

const Registered = () => {
	return (
		<div className="registeredBox">
			<div className="registerBoxInner">
				<div className={buttonStyles.btnCta}>註冊</div>
				<div className="subText">26 註冊 • 11 喜歡</div>
			</div>
		</div>
	);
};

export default Registered;
